import './App.css';
import {BrowserRouter as Router,Route} from 'react-router-dom'

import PostListAgain from './components/PostListAgain';
import Navbar from './components/Navbar/Navbar'
import UserPage from './components/Navbar/UserPage';
import Comments from './components/Comments';
function App() {
  return (
    <Router>
    <div className="App">
      <Navbar/>


    </div>
    <Route path='/User' >
    <PostListAgain/>

    </Route>

    <Route path='/Comments' >
    <Comments />

    </Route>


    </Router>
  );
}

export default App;
